    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Innoko NWR for the next 15 years. This plan outlines
    the Refuge vision and purpose and describes how Innoko NWR will contribute to the
    overall mission of the Refuge System. The plan provides an introduction to the Refuge,
    an overview of the CCP process, a summary of Refuge resources, goals and objectives,
    and information about the management direction, monitoring, and coordination. Key
    planning issues include: moose harvesting, visitor access, water quality, climate
    change, bison management, and regional guidelines.",nt"license_title": "License
